import {
  WV_CLS_IOS_BOOKMARK,
} from '../constants';
import { encodeParams } from '../utils/exec';
import { generateAPI } from '../utils/generate-api';
import { warn } from '../utils/log';
import { dispatchAsEvent } from '../utils/events';

/**
 * 内部事件名
 *
 * @type {string}
 */
const EVT_NAME = 'addedBookMark';

/**
 * 加书架全局回调名
 * bookStore.bookCover().addedAppBookMark
 */
const MODULE_NAME = 'bookstore';
const FUNCTION_NAME = 'bookCover';
const CLASS_NAME = 'BookCover';
const CB_NAME = 'addedAppBookMark';

/**
 * 重置回调函数，通过发送事件方式实现
 */
function setEvent() {
  if (window[MODULE_NAME] && window[MODULE_NAME][FUNCTION_NAME]) {
    if (window[MODULE_NAME][CLASS_NAME]) {
      window[MODULE_NAME][CLASS_NAME].prototype[CB_NAME] = function addedBookmarkCallback(params = {}) {
        dispatchAsEvent(EVT_NAME, params).catch((e) => {
          warn(`[${CB_NAME}][error]: `, e);
        });
      };
    }
    return;
  }
  if (!window[MODULE_NAME]) {
    window[MODULE_NAME] = {};
  }
  if (!window[MODULE_NAME][FUNCTION_NAME]) {
    window[MODULE_NAME][FUNCTION_NAME] = () => ({
      [CB_NAME](params) {
        dispatchAsEvent(EVT_NAME, params).catch((e) => {
          warn(`[${CB_NAME}][error]: `, e);
        });
      },
    });
  }
}

async function preParam(params = {}) {
  setEvent();
  params.readTo = params.readTo || 'app';
  params.cId = `${params.cId}` || '1';
  return params;
}

async function preAndroidParam(params = {}) {
  return encodeParams(await preParam(params));
}

/**
 * 加入书架
 *
 * 支持平台：书旗Android、书旗iOS
 *
 // * @param {String} type: 书籍来源(shuqi/shenma)
 // * @param {String} readTo: 打开阅读方式(app/web)
 // * @param {String} bookId:书籍Id
 // * @param {String} bookName:书籍名
 // * @param {String} author:作者
 // * @param {String} imgUrl:封面图
 // * @param {String} cId 章节Id(默认第一章)
 // * @param {String} cName 章节名
 // * @param {String} cKey：章节contentKey(神马书籍)
 // * @param {int} status:连载状态：1:连载、2:完结、3:暂停
 // * @param {String} topClass：topClass
 // * @param {String} payMode: payMode
 // * @param {String} isBuy：是否已购买
 *
 * @returns {Promise<*>}   成功1，失败0
 *
 * @example
 * libSQ.exec('add-app-book-mark', {
 *   params: {
 *     type: 'shuqi',
 *     readTo: 'app',
 *     bookId: '7131264',
 *     bookName: '重生小时候',
 *     author: '花瑾',
 *     imgUrl: 'http://img-tailor.11222.cn/bcv/big/201706201738443950.jpg',
 *     cId: '798782',
 *     cName: '第一章：就像一场梦一样',
 *     cKey: '',
 *     status: '2',
 *     topClass: '502',
 *     payMode: '3',
 *     isBuy: 'false',
 *   },
 * }).then((info) => {
 *   console.log(`[add-app-book-mark][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[add-app-book-mark][error] ${JSON.stringify(err, null, 2)}`);
 * });
 *
 */
export const addAppBookMark = generateAPI({
  wv: {
    ios: {
      className: WV_CLS_IOS_BOOKMARK,
      methodName: 'addAppBookMark',
      preParam,
    },
  },
  ios: {
    preParam,
    bridgeName: 'addAppBookMark',
  },
  android: {
    bridgeName: 'addAppBookMark',
    preParam: preAndroidParam,
  },
});

