import { generateAPI } from '../utils/generate-api';
import { WV_CLS_IOS_CUSTOM } from '../constants/wv-ios';
import { GLOBAL_CALLBACK_PREFIX, GLOBAL_CALLBACK_SET } from '../constants';
import { warn } from '../utils/log';

/**
 * 本 API 的全局回调名
 * @type {string}
 */
const CB_NAME = `${GLOBAL_CALLBACK_PREFIX}bookstore-verify`;

/**
 * 需要等待回调的任务队列
 *
 * @type {Array<function>}
 */
const pendingTasks = [];

/**
 * 本 API 的全局
 *
 * @returns {Promise<void>}
 */
window[GLOBAL_CALLBACK_SET][CB_NAME] = async function (data) {
  pendingTasks.forEach((fn) => {
    try {
      fn(data);
    } catch (e) {
      warn(e);
    }
  });
  pendingTasks.splice(0, pendingTasks.length);
};

/**
 * 将需要等待回调的任务添加到任务队列
 *
 * @returns {Promise<*>}
 */
async function addPendingTask() {
  return new Promise((resolve) => {
    pendingTasks.push((data) => {
      resolve(data);
    });
  });
}

async function preParam(params = {}) {
  return ['bookstore', 'verify', params, `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME}"]`];
}

async function postResult() {
  return addPendingTask();
}

/**
 * bookstore-verify 验证网页数据
 *
 * 支持平台：书旗Android、iOS
 *
 * @returns {Promise<{ret: value}>}
 *
 * @example
 * libSQ.exec('bookstore-verify', {
 *   params: {
 *     data: 10,
 *    type: 2,
 *   },
 * }).then((info) => {
 *   alert(`[bookstore-verify][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[bookstore-verify][error] ${JSON.stringify(err, null, 2)}`);
 * });
 */
export const bookstoreVerify = generateAPI({
  wv: {
    ios: {
      className: WV_CLS_IOS_CUSTOM,
      methodName: 'verify',
      async preParam(params = {}) {
        params.callback = `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME}"]`;
        return params;
      },
      postResult,
    },
  },
  ios: {
    bridgeName: 'exec',
    preParam,
    postResult,
  },
  android: {
    bridgeName: 'exec',
    preParam,
    postResult,
  },
});

examples:
