 *     smallImgUrl: 'http://img-tailor.11222.cn/bcv/small/201702181520188904.jpg', // optional, 小图地址
 *   }, {
 *     bigImgUrl: 'http://img-tailor.11222.cn/bcv/big/201706211333002338.jpg', // 大图地址
 *     smallImgUrl: 'http://img-tailor.11222.cn/bcv/small/201706211333002338.jpg', // optional, 小图地址
