/**
 * 下载app
 *
 * @author liyizhe
 * @date 2019.04.19
 */

import { dispatchAsEvent } from '../utils/events';
import { generateAPI } from '../utils/generate-api';
import { GLOBAL_CALLBACK_PREFIX, GLOBAL_CALLBACK_SET } from '../constants';
import { warn } from '../utils/log';

/**
 * 内部事件名
 *
 * @type {string}
 */
const EVT_NAME = 'callDownloadApp';

/**
 * 本 API 的全局回调名
 * @type {string}
 */
const CB_NAME = `${GLOBAL_CALLBACK_PREFIX}call-download-app`;

/**
 * 需要等待回调的任务队列
 *
 * @type {Array<function>}
 */
const pendingTasks = [];

/**
 * 本 API 的全局。主要接受书旗android的回调
 *
 * @returns {Promise<void>}
 */
window[GLOBAL_CALLBACK_SET][CB_NAME] = async function (result) {
  try {
    await dispatchAsEvent(EVT_NAME, result);
  } catch (e) {
    warn(e);
  }
};

/**
 * 接受以上书旗android来的event
 */
document.addEventListener(EVT_NAME, (evt) => {
  pendingTasks.forEach((fn) => {
    try {
      fn(evt.detail);
    } catch (e) {
      warn(e);
    }
  });
  pendingTasks.splice(0, pendingTasks.length);
});

/**
 * 将需要等待回调的任务添加到任务队列
 *
 * @returns {Promise<*>}
 */
async function addPendingTask() {
  return new Promise((resolve) => {
    pendingTasks.push((data) => {
      resolve(data);
    });
  });
}

async function postResult() {
  return addPendingTask();
}

/**
 * 书旗android
 * @param params
 * {
 *    "packageName":"xx",  //必填。包名
 *    "downloadUrl":"",  //必填。下载地址
 * }
 *
 * @returns {Promise.<[string,string,null,string]>}
 */
async function preParamSQAnd(params = {}) {
  return ['download', 'downloadThirdApp', params, `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME}"]`];
}

/**
 * 开始下载app
 *
 * 支持平台：书旗Android
 *
 * @return {Promise.<void>}
 *
 * @example
 * const params = {
 *   packageName: 'com.shuqi.controller', // 必填。包名
 *   downloadUrl: 'xxx', // 必填。下载地址
 * };
 * lib.exec('call-download-app', {
 *   params,
 * }).then((info) => {
 *   alert(`[call-download-app'][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[call-download-app'][error] ${JSON.stringify(err, null, 2)}`);
 * });
 */
export const callDownloadApp = generateAPI({
  android: {
    preParam: preParamSQAnd,
    bridgeName: 'exec',
    postResult,
  },
});

