import {
  WV_CLS_IOS_BASE_UI,
} from '../constants';
import { isUndefined } from '../utils/is-a';
import { encodeParams } from '../utils/exec';
import { generateAPI } from '../utils/generate-api';

async function preParam(params = {}) {
  const { message, loadError, loading } = params;

  let encodedParams = {};

  if (!isUndefined(message)) {
    encodedParams = encodeParams({
      message,
    });
  } else if (loadError) {
    encodedParams = encodeParams({
      loadError,
    });
  } else {
    encodedParams = encodeParams({
      loading,
    });
  }

  return encodedParams;
}

async function preParamCloseLoading() {
  return preParam({ loading: 'hide' });
}
async function preParamShowError() {
  return preParam({ loadError: 'show' });
}

