import { decodeResult } from '../utils/exec';
import {
  WV_CLS_IOS_ENV,
} from '../constants';
import { generateAPI } from '../utils/generate-api';

/**
 * 获取 App 信息
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * libSQ.exec('get-app-info').then((info) => {
 *   alert(`[get-app-info][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[get-app-info][error] ${JSON.stringify(err, null, 2)}`);
 * });
 */
export const getAppInfo = generateAPI({
  wv: {
    ios: {
      className: WV_CLS_IOS_ENV,
      methodName: 'getAppInfo',
    },
  },
  ios: {
    bridgeName: 'getAppInfo',
  },
  android: {
    bridgeName: 'getAppConfigVersion',
    async postResult(r) {
      const result = decodeResult(r);

      if (result.feature) {
        const feature = result.feature.split('_');
        result.feature = {};
        let featureName;
        let featureValue;
        for (const f in feature) {
          if (Object.prototype.hasOwnProperty.call(feature, f)) {
            [featureName, featureValue] = feature[f].split(',');
            result.feature[featureName] = featureValue;
          }
        }
      } else {
        result.feature = {};
      }

      if (result.schemeList) {
        result.schemeList = result.schemeList.split(',');
      } else {
        result.schemeList = {};
      }

      return result;
    },
  },
});

