/**
 * 内部事件名
 *
 * @type {string}
 */
const EVT_NAME = 'getMemberInfo';

/**
 * 本 API 的全局回调名
 * @type {string}
 */
const CB_NAME_ANDROID = `${GLOBAL_CALLBACK_PREFIX}get-member-info-android`;
const CB_NAME_IOS = `${GLOBAL_CALLBACK_PREFIX}get-member-info-ios`;
/**
 * 本 API 的全局
 *
 * @returns {Promise<void>}
 */
window[GLOBAL_CALLBACK_SET][CB_NAME_IOS] = async function () {
  try {
    await dispatchAsEvent(EVT_NAME, (await getMemberInfo)());
  } catch (e) {
    warn(e);
  }
};

window[GLOBAL_CALLBACK_SET][CB_NAME_ANDROID] = async function (result = '{}') {
  try {
    const data = JSON.parse(result);
    await dispatchAsEvent(EVT_NAME, data);
  } catch (e) {
    warn(e);
  }
};

/**
 * 需要等待回调的任务队列
 *
 * @type {Array<function>}
 */
const pendingTasks = [];

document.addEventListener(EVT_NAME, (evt) => {
  pendingTasks.forEach((fn) => {
    try {
      fn(evt.detail);
    } catch (e) {
      warn(e);
    }
  });
  pendingTasks.splice(0, pendingTasks.length);
});

/**
 * 将需要等待回调的任务添加到任务队列
 *
 * @returns {Promise<*>}
 */
async function addPendingTask() {
  return new Promise((resolve) => {
    pendingTasks.push((data) => {
      resolve(data);
    });
  });
}

async function preParam(params = {}) {
  if (`${params.isRefresh}` === '1') {
    params.callback = `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME_IOS}"]`;
  }

  return params;
}

async function postResult(result, params = {}) {
  if (`${params.isRefresh}` === '1') {
    return addPendingTask();
  }

  return result;
}

/**
 * 获取 会员 信息
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
