 * });
 * 带参数传递调用
 * libSQ.exec('get-member-info', {
 *   params: {
 *     isRefresh: '1',
 *   },
 * }).then((info) => {
 *   alert(`[refresh][get-member-info][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[refresh][get-member-info][error] ${JSON.stringify(err, null, 2)}`);
 * });
 */
export const getMemberInfo = generateAPI({
  wv: {
    ios: {
      className: WV_CLS_IOS_USER,
      methodName: 'getAppUserInfo',
      preParam,
      postResult,
    },
  },
  ios: {
    preParam,
    postResult,
    bridgeName: 'getAppUserInfo',
  },
  android: {
    async preParam() {
      return ['user', 'getMemberInfo', '', `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME_ANDROID}"]`];
