import {
  WV_CLS_IOS_USER,
  WV_CLS_TMIOS_USER,
} from '../constants/wv-ios';
import { dispatchAsEvent } from '../utils/events';
import { generateAPI } from '../utils/generate-api';
import { GLOBAL_CALLBACK_PREFIX, GLOBAL_CALLBACK_SET, MINI_ALIPAY_EVENT } from '../constants';
import { warn } from '../utils/log';

/**
 * 内部事件名
 *
 * @type {string}
 */
const EVT_NAME = 'getThirdPartUserInfo';

/**
 * 本 API 的全局回调名
 * @type {string}
 */
const CB_NAME = `${GLOBAL_CALLBACK_PREFIX}get-third-part-user-info`;

/**
 * 需要等待回调的任务队列
 *
 * @type {Array<function>}
 */
const pendingTasks = [];

/**
 * 本 API 的全局。主要接受书旗android的回调
 *
 * @returns {Promise<void>}
 */
window[GLOBAL_CALLBACK_SET][CB_NAME] = async function (result) {
  try {
    result = JSON.parse(result);
    await dispatchAsEvent(EVT_NAME, result);
  } catch (e) {
    warn(e);
  }
};

/**
 * 接受以上书旗android来的event
 */
document.addEventListener(EVT_NAME, (evt) => {
  pendingTasks.forEach((fn) => {
    try {
      fn(evt.detail);
    } catch (e) {
      warn(e);
    }
  });
  pendingTasks.splice(0, pendingTasks.length);
});

/**
 * 支付宝小程序的回调
 * @returns {Promise}
 */
document.addEventListener(MINI_ALIPAY_EVENT, (evt) => {
  const { detail } = evt || {};
  if (detail.event === 'getTaobaoId') {
    pendingTasks.forEach((fn) => {
      try {
        fn(detail.data);
      } catch (e) {
        warn(e);
      }
    });
    pendingTasks.splice(0, pendingTasks.length);
  }
});

/**
 * 将需要等待回调的任务添加到任务队列
 *
 * @returns {Promise<*>}
 */
async function addPendingTask() {
  return new Promise((resolve) => {
    pendingTasks.push((data) => {
      resolve(data);
    });
  });
}

async function postResult() {
  return addPendingTask();
}

/**
 * 书旗android支持了获取三方类型传参
 * @param params
 * @returns {Promise.<[string,string,null,string]>}
 */
async function preParamSQAnd(params = {}) {
  return ['user', 'getThirdPartUserInfo', params, `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME}"]`];
}

/**
 * 天猫入参，将callback设置进去
 */
async function preParamTMAnd(params = {}) {
  const preParams = params;
  preParams.callback = `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME}"]`;
  return preParams;
}

/**
 * 支付宝小程序入参
 */
async function preParamMiNi_AliPay() {
  const preParams = {
    event: 'getTaobaoId',
  };
  return preParams;
}

/**
 * 获取三方授权用户信息，其中书旗Android支持"TAOBAO/WECHAT/SINA/ALIPAY/QQ"
 *
 * 支持平台：书旗Android、书旗iOS、天猫Android、天猫iOS、支付宝小程序
 *
 * @return {Promise.<void>}
 *
 * @example
 * libSQ.exec('get-third-part-user-info', {
 *   params: {
 *     type: 'TAOBAO',
 *   },
 * }).then((info) => {
 *   alert(`[get-third-part-user-info][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[get-third-part-user-info][error] ${JSON.stringify(err, null, 2)}`);
 * });
 */
export const getThirdPartUserInfo = generateAPI({
  miniProgram: {
    aliPay_sqReader: {// 支付宝小程序
      methodName: 'postMessage',
      preParam: preParamMiNi_AliPay,
      postResult,
    },
  },
  wv: {
    ios: {
      className: WV_CLS_IOS_USER,
      methodName: 'getThirdPartUserInfo',
    },
    android_tmReader: {// windwane android 调用方式和非windwane一样，对象.call方法
      bridgeName: 'getThirdPartUserInfo',
      preParam: preParamTMAnd,
      postResult,
    },
    ios_tmReader: {
      className: WV_CLS_TMIOS_USER,
      methodName: 'getThirdPartUserInfo',
    },
  },
  ios: {
    bridgeName: 'exec',
    postResult,
  },
  android: {
    preParam: preParamSQAnd,
    bridgeName: 'exec',
    postResult,
  },
});

examples:
libSQ.exec('get-third-part-user-info', {
  params: {
    type: 'TAOBAO',
  },
}).then((info) => {
  alert(`[get-third-part-user-info][then] ${JSON.stringify(info, null, 2)}`);
}).catch((err) => {
  alert(`[get-third-part-user-info][error] ${JSON.stringify(err, null, 2)}`);
});

