import {
  WV_CLS_IOS_USER,
  GLOBAL_CALLBACK_PREFIX,
  GLOBAL_CALLBACK_SET,
  WV_CLS_TMIOS_USER,
  MINI_MED_ALIPAY_INFO,
  MINI_ALIPAY_EVENT,
} from '../constants';
import { decodeResult, encodeParams } from '../utils/exec';
import { dispatchAsEvent } from '../utils/events';
import { warn } from '../utils/log';
import { generateAPI } from '../utils/generate-api';

/**
 * 内部事件名
 *
 * @type {string}
 */
const EVT_NAME = 'getUserInfo';

/**
 * 本 API 的全局回调名
 * @type {string}
 */
const CB_NAME = `${GLOBAL_CALLBACK_PREFIX}get-user-info`;

/**
 * 需要等待回调的任务队列
 *
 * @type {Array<function>}
 */
const pendingTasks = [];

/**
 * 本 API 的全局
 *
 * @returns {Promise<void>}
 */
window[GLOBAL_CALLBACK_SET][CB_NAME] = async function () {
  try {
    await dispatchAsEvent(EVT_NAME, (await getUserInfo)());
  } catch (e) {
    warn(e);
  }
};

/**
 * 接受以上来的event
 */
document.addEventListener(EVT_NAME, (evt) => {
  pendingTasks.forEach((fn) => {
    try {
      fn(evt.detail);
    } catch (e) {
      warn(e);
    }
  });
  pendingTasks.splice(0, pendingTasks.length);
});

/**
 * 支付宝小程序的回调
 * @returns {Promise}
 */
document.addEventListener(MINI_ALIPAY_EVENT, (evt) => {
  const { detail } = evt || {};
  if (detail.event === MINI_MED_ALIPAY_INFO) {
    pendingTasks.forEach((fn) => {
      try {
        fn(detail.data);
      } catch (e) {
        warn(e);
      }
    });
    pendingTasks.splice(0, pendingTasks.length);
  }
});

/**
 * 将需要等待回调的任务添加到任务队列
 *
 * @returns {Promise<*>}
 */
async function addPendingTask() {
  return new Promise((resolve) => {
    pendingTasks.push((data) => {
      resolve(data);
    });
  });
}

async function postResult(result, params = {}) {
  if (`${params.isRefresh}` === '1') {
    return addPendingTask();
  }

  return result;
}

/**
 * 支付宝小程序
 *
 * @returns {Promise.<{event: string, data: {path: string}}>}
 */
async function preParamMiNi_AliPay() {
  const preParams = {
    event: MINI_MED_ALIPAY_INFO,
  };
  return preParams;
}

async function preParam(params = {}) {
  if (`${params.isRefresh}` === '1') {
    params.callback = `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME}"]`;
  }

  return params;
}

/**
 * 获取用户基本信息
 *
 * 支持平台：书旗Android、书旗iOS、天猫Android、天猫iOS、支付宝小程序
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('get-user-info', {
 *    params: {
 *      isRefresh: '1',
 *    },
 *  }).then((info) => {
 *    alert(`[refresh][get-user-info][then] ${JSON.stringify(info, null, 2)}`);
 *  }).catch((err) => {
 *    alert(`[refresh][get-user-info][error] ${JSON.stringify(err, null, 2)}`);
 *  });
 */
export const getUserInfo = generateAPI({
  miniProgram: {
    aliPay_sqReader: {// 支付宝小程序
      methodName: 'postMessage',
      preParam: preParamMiNi_AliPay,
      postResult,
    },
  },
  wv: {
    ios: {
      className: WV_CLS_IOS_USER,
      methodName: 'getAppUserInfo',
      preParam,
      postResult,
    },
    ios_tmReader: {
      className: WV_CLS_TMIOS_USER,
      methodName: 'getUserInfo',
    },
    android_tmReader: {// windwane android 调用方式和非windwane一样，对象.call方法
      bridgeName: 'getUserInfo',
    },
  },
  ios: {
    preParam,
    postResult,
    bridgeName: 'getAppUserInfo',
  },
  android: {
    async preParam(params = {}) {
      const p = await preParam(params);
      return encodeParams(p);
    },
    async postResult(r, p) {
      return postResult(decodeResult(r), p);
    },
    bridgeName: 'getAppUserInfo',
  },
});

