import {
  GLOBAL_CALLBACK_PREFIX,
  WV_CLS_IOS_CUSTOM,
  GLOBAL_CALLBACK_SET,
} from '../constants';
import { dispatchAsEvent } from '../utils/events';
import { warn } from '../utils/log';
import { generateAPI } from '../utils/generate-api';

/**
 * 内部事件名
 *
 * @type {string}
 */
const EVT_NAME = 'notifyBackToView';

/**
 * 本 API 的全局回调名
 * @type {string}
 */
const CB_NAME = `${GLOBAL_CALLBACK_PREFIX}notify-back-to-view`;

window[GLOBAL_CALLBACK_SET][CB_NAME] = function notifyBackToViewCallback() {
  dispatchAsEvent(EVT_NAME).catch((e) => {
    warn(`[${CB_NAME}][error]: `, e);
  });
};

async function preParam(params = {}) {
  params.callback = `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME}"]`;
  return params;
}

/**
 * 启动监听：用户从当前 WebView 打开新的 WebView 之后，再返回当前 WebView
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<void>}
 *
 * @example
 * libSQ.exec('notify-back-to-view').then(function (info) {
 *   alert('[from ready][notify-back-to-view][then] ' + JSON.stringify(info, null, 2));
 * }).catch(function (err) {
 *   alert('[from ready][notify-back-to-view][error] ' + JSON.stringify(err, null, 2));
 *   alert(err.detail.__$rawError__.stack);
 * });
 */
export const notifyBackToView = generateAPI({
  wv: {
    ios: {
      className: WV_CLS_IOS_CUSTOM,
      methodName: 'refreshBrowserCallback',
      preParam,
    },
  },
  ios: {
    preParam,
    bridgeName: 'refreshBrowserCallback',
  },
  android: {
    preParam,
    bridgeName: 'refreshBrowserCallback',
  },
});

