async function preParam(params = {}) {
  const {
    id,
    coverUrl,
    remark,
    skinType,
    name,
    shareUrl,
    shareTitle,
    shareContent,
  } = params;
  const packageInfo = params.package;
  const preParams = {
    name,
    shareUrl,
    shareTitle,
    shareContent,
  };

  if (!isUndefined(id)) {
    preParams.themeId = id;
  }

  if (!isUndefined(coverUrl)) {
    preParams.imgUrl = coverUrl;
  }

  if (!isUndefined(packageInfo) && isObject(packageInfo)) {
    const { packageSize, downloadUrl, skinVersion } = packageInfo;
    if (!isUndefined(packageSize)) {
      preParams.size = packageSize;
    }

    if (!isUndefined(downloadUrl)) {
      preParams.downloadUrl = downloadUrl;
    }

    if (!isUndefined(skinVersion)) {
      preParams.version = skinVersion;
    }
  }

  if (!isUndefined(remark)) {
    preParams.desc = remark;
  }

  if (!isUndefined(skinType)) {
    preParams.type = Number(skinType);
