 * @returns {Promise.<{bookId: *, topClass: string, status: number}>}
 */
async function preParamAndroid(params = {}) {
  const { bookId, bookName, topClass = '502', status = 1 } = encodeParams(params);
  const preParams = { bookId, topClass, status };

  if (isUndefined(bookName)) {
    preParams.bookName = encodeParams('书旗小说');
  }
  preParams.status = Number(status);

  return preParams;
}

/**
 * 天猫android ios
 * @param params
 * @returns {Promise.<{backHome: boolean, route: [null]}>}
 */
async function preParamTM(params = {}) {
  const { bookId, bookName, topClass = '503' } = encodeParams(params);
  const preParams = {
    backHome: false,
    route: [
      {
        page: 'bookCover',
        params: {
          bookId,
          bookName,
          topClass,
        },
      },
    ],
  };

  if (isUndefined(bookName)) {
    preParams.bookName = encodeParams('书旗小说');
  }

  return preParams;
}

/**
 * 天猫小程序
 * @param params
 * @returns {Promise.<{event: string, data: {path: string}}>}
 */
async function preParamMiNi_TMReader(params = {}) {
  const { bookId } = params;
  const preParams = {
    event: MINI_MED_TM_NAVIGATOR,
    data: {
      path: `/cover/${bookId}`,
    },
  };
  return preParams;
}

