import {
  WV_CLS_IOS_NAVIGATOR,
  WV_CLS_TMIOS_NAVIGATOR,
  MINI_MED_TM_NAVIGATOR,
  MINI_MED_ALIPAY_NAVIGATOR,
} from '../constants';
import { encodeParams } from '../utils/exec';
import { generateAPI } from '../utils/generate-api';
import { isUndefined } from '../utils/is-a';
import { warn } from '../utils/log';

/**
 * openWebPage Android书旗
 */
async function preParam(params = {}) {
  const { title, url } = params;

  return encodeParams({
    webTitle: title,
    webUrl: url,
  });
}

/**
 * openWebPage iOS书旗
 */
async function preParamIOS(params = {}) {
  const common = await preParam(params);
  const { webAppInfoKey, target, webUrl } = params;

  // 这里特殊判定，如果要跳转的页面是会员特权页，则需要添加target = ‘monthlyPrivilege’参数
  try {
    if (webUrl) {
      if (webUrl.indexOf('sq_pg_param=bspi') !== -1 && !target) {
        common.target = 'monthlyPrivilege';
      }
    }
  } catch (e) {
    warn(e);
  }

  if (!isUndefined(webAppInfoKey)) {
    common.webAppInfoKey = webAppInfoKey;
  }

  return common;
}

/**
 * openCouponInfo iOS
 */
async function preParamCouponIOS(params = {}) {
  const { title = '代金券列表' } = params;
  return preParamIOS({
    title,
    webAppInfoKey: [
      'bookstore',
      'couponInfo',
    ],
  });
}

async function preParamTM(params = {}) {
  const { url, title } = encodeParams(params);
  const preParams = {
    backHome: false,
    route: [
      {
        page: 'browser',
        params: {
          url,
          title,
        },
      },
    ],
  };

  return preParams;
}

async function preParamMiNi_TMReader(params = {}) {
  const { url } = params;
  const preParams = {
    event: MINI_MED_TM_NAVIGATOR,
    data: {
      url,
    },
  };
  return preParams;
}

async function preParamMiNi_SQReader(params = {}) {
  const { url } = params;
  const preParams = {
    event: MINI_MED_ALIPAY_NAVIGATOR,
    data: {
      actionType: 'url',
      url,
    },
  };
  return preParams;
}

/**
 * 使用 WebView 打开普通网页
 *
 * 支持平台：书旗Android、书旗iOS、天猫Android、天猫iOS、支付宝小程序、淘宝小程序
 *
 * @param {Object} params - 调用客户端桥所需要的参数
 * @param {string} params.title - 新 WebView 的页面标题
 * @param {string} params.url - 网页 URL 地址
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('open-web-page', {
 *    params: {
 *      title: '233333',
 *      url: 'http://m.taobao.com'
 *    },
 *  }).catch(function (err) {
 *    alert('[from ready][open-web-page][error] ' + JSON.stringify(err, null, 2));
 *    alert(err.detail.__$rawError__.stack);
 *  });
 */
export const openWebPage = generateAPI({
  miniProgram: {
    tb_tmReader: {// 淘宝小程序
      methodName: 'postMessage',
      preParam: preParamMiNi_TMReader,
    },
    aliPay_sqReader: {// 支付宝小程序
      methodName: 'postMessage',
      preParam: preParamMiNi_SQReader,
    },
  },
  wv: {
    ios: {
      className: WV_CLS_IOS_NAVIGATOR,
      methodName: 'openAppWebPage',
      preParam: preParamIOS,
    },
    ios_tmReader: {
      className: WV_CLS_TMIOS_NAVIGATOR,
      methodName: 'openAppPage',
      preParam: preParamTM,
    },
    android_tmReader: {
      bridgeName: 'openAppPage',
      preParam: preParamTM,
    },
  },
  ios: {
    preParam: preParamIOS,
    bridgeName: 'openAppWebPage',
  },
  android: {
    preParam,
    bridgeName: 'openAppWebPage',
  },
});

/**
 * 打开豆券（代金券）列表页
 */
export const openCouponInfo = generateAPI({
  wv: {
    ios: {
      className: WV_CLS_IOS_NAVIGATOR,
      methodName: 'openAppWebPage',
      preParam: preParamCouponIOS,
    },
  },
  ios: {
    preParam: preParamCouponIOS,
    bridgeName: 'openAppWebPage',
  },
  android: {
    bridgeName: 'openAppActivity',
    async preParam() {
      return { pageName: 'douticketList' };
    },
  },
});

examples:
libSQ.exec('open-web-page', {
   params: {
     title: '233333',
     url: 'http://m.taobao.com'
   },
 }).catch(function (err) {
   alert('[from ready][open-web-page][error] ' + JSON.stringify(err, null, 2));
   alert(err.detail.__$rawError__.stack);
 });

