import {
  WV_CLS_IOS_NAVIGATOR,
} from '../constants';
import { generateAPI } from '../utils/generate-api';
import { encodeParams } from '../utils/exec';
import { isUndefined } from '../utils/is-a';

async function preParamCommon(params = {}) {
  // if (!params.firstCid) {
  //   params.firstCid = '1';
  // }
  // if (!params.cId) {
  //   params.cId = '1';
  // }
  if (!params.readMark) {
    params.readMark = 'web';
  }

  return params;
}

/**
 * 打开收费阅读页
 *
 * @param {Object} params
 * @param {number} params.bookId - 书籍 id
 * @param {string} params.bookName - 书籍名称
 * @param {string} params.authorName - 作者名
 * @param {number} params.firstChapterId - 第一章 id
 * @param {string} params.coverUrl - 封面 URL
 * @param {string} params.formats - 1 普通书籍，2 epub 书籍
 * @param {string} params.miguBookId - 咪咕书籍 id
 * @param {string} [params.topClass] - 书籍类型（502 网文，503 出版物，666 漫画，667 轻小说）
 * @param {number} [params.readChapterId] - 阅读章节 id
 * @param {string} [params.readChapterName] - 阅读章节名
 * @param {number} [params.readChapterIndex] - 阅读章节序号，和阅读章节不共存（从 1 开始）
 *
 * @returns {Promise<{}>}
 */
async function preParamIOS(params = {}) {
  const p = await preParamCommon(params);

  const {
    bookId,
    bookName,
    authorName,
    firstChapterId,
    coverUrl,
    topClass,
    formats,
    miguBookId, // 可以暂时不管咪咕书籍
    readChapterId,
    readChapterName,
    readChapterIndex,
    readMark,
  } = p;

  const processedParams = {
    bookId: `${bookId}`,
    bookName,
    author: authorName,
    imageUrl: coverUrl,
    readMark,
  };

  if (!isUndefined(firstChapterId)) {
    processedParams.firstCid = `${firstChapterId}`;
  }

  if (!isUndefined(topClass)) {
    processedParams.topClass = `${topClass}`;
  }

  if (!isUndefined(formats)) {
    processedParams.formats = `${formats}`;
  }

  if (!isUndefined(miguBookId)) {
    processedParams.externalbid = `${miguBookId}`;
  }

  // iOS 优先使用 index 定位
  if (!isUndefined(readChapterIndex)) {
    processedParams.cIndex = parseInt(readChapterIndex, 10) || 1;
  } else if (!isUndefined(readChapterId) && !isUndefined(readChapterName)) {
    processedParams.cId = `${readChapterId}`;
    processedParams.cName = readChapterName;
  }

  return encodeParams(processedParams);
}

/**
 * 打开收费阅读页
 *
 * @param {Object} params
 * @param {number} params.bookId - 书籍 id
 * @param {string} params.bookName - 书籍名称
 * @param {string} params.authorName - 作者名
 * @param {string} params.authorId - 作者名
 * @param {number} params.firstChapterId - 第一章 id
 * @param {string} params.coverUrl - 封面 URL
 * @param {string} params.formats - 1 普通书籍，2 epub 书籍
 * @param {boolean} params.monthlyFlag - 包月书状态：true/false
 * @param {string} params.miguBookId - 咪咕书籍 id
 * @param {string} [params.topClass] - 书籍类型（502 网文，503 出版物，666 漫画，667 轻小说）
 * @param {number} [params.readChapterId] - 阅读章节 id
 * @param {string} [params.readChapterName] - 阅读章节名
 * @param {number} [params.readChapterIndex] - 阅读章节序号，和阅读章节不共存（从 1 开始）
 *
 * @returns {Promise<{}>}
 */
async function preParamAndroid(params = {}) {
  const p = await preParamCommon(params);

  const {
    bookId,
    bookName,
    authorName,
    authorId,
    firstChapterId,
    coverUrl,
    topClass,
    formats = '1',
    miguBookId, // 可以暂时不管咪咕书籍
    readChapterId,
    readChapterName,
    readChapterIndex,
    monthlyFlag,
    readMark,
  } = p;

  const processedParams = {
    bookId: `${bookId}`,
    bookName,
    author: `${authorId}`,
    authorId: `${authorId}`,
    authorName,
    imageUrl: coverUrl,
    readMark,
  };

  if (!isUndefined(monthlyFlag)) {
    const flagStr = `${monthlyFlag}`;
    processedParams.monthly_flag = (flagStr === 'true' || flagStr === '1') ? '1' : '0';
  }

  if (!isUndefined(firstChapterId)) {
    processedParams.firstCid = `${firstChapterId}`;
  }

  if (!isUndefined(topClass)) {
    processedParams.topClass = `${topClass}`;
  }

  if (!isUndefined(formats)) {
    processedParams.formats = `${formats}`;
  }

  if (!isUndefined(miguBookId)) {
    processedParams.type = 'migu';
    processedParams.externalbid = `${miguBookId}`;
  }

  // Android 优先使用 ID 定位
  if (!isUndefined(readChapterId) && !isUndefined(readChapterName)) {
    processedParams.cId = `${readChapterId}`;
    processedParams.cName = readChapterName;
  } else if (!isUndefined(readChapterIndex)) {
    processedParams.cIndex = parseInt(readChapterIndex, 10) || 1;
  }

  return encodeParams(processedParams);
}

/**
 * 打开收费阅读页（可指定章节，默认为第一章）
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}   成功1，失败0
 *
 */
export const readPayBook = generateAPI({
  wv: {
    ios: {
      className: WV_CLS_IOS_NAVIGATOR,
      methodName: 'readPayBook',
      preParam: preParamIOS,
    },
  },
  ios: {
    preParam: preParamIOS,
    bridgeName: 'readPayBook',
  },
  android: {
    preParam: preParamAndroid,
    bridgeName: 'readPayBook',
  },
});

