import { generateAPI } from '../utils/generate-api';
import { WV_CLS_IOS_BASE_UI, SHARE_INFO_CHANGE, WV_CLS_TMIOS_NAVIGATOR, SHARE_INFO_CHANGE_ALIPAY } from '../constants/wv-ios';

async function preParamSQIOS(params = {}) {
  return ['ui', 'openAppSendShareData', params];
}

async function preParamSQAndroid(params = {}) {
  return ['share', 'share', params, ''];
}

async function preParamsWv(params = {}) {
  const preParams = params;
  return preParams;
}

/**
 * 天猫小程序
 * @param params
 * @returns {Promise.<{event: string, data: {path: string}}>}
 */
async function preParamMiNi_TMReader(params = {}) {
  const { shareUrl, shareTitle, shareContent, imgUrl, platform, shareFrom } = params;
  const preParams = {
    event: SHARE_INFO_CHANGE,
    data: {
      title: shareTitle,
      desc: shareContent,
      imageUrl: imgUrl,
      targetUrl: shareUrl,
      platform,
      shareFrom,
    },
  };
  return preParams;
}

/**
 * 书旗小程序
 * @param params
 * @returns {Promise.<{event: string, data: {actionType: string, scheme: string}}>}
 */
async function preParamMiNi_SQReader(params = {}) {
  const { shareUrl, shareTitle, shareContent, imgUrl, shareFrom } = params;
  const preParams = {
    event: SHARE_INFO_CHANGE_ALIPAY,
    data: {
      title: shareTitle,
      desc: shareContent,
      imageUrl: imgUrl,
      path: `pages/webview/webview?type=share&path=${encodeURIComponent(shareUrl)}`,
      from: shareFrom,
    },
  };
  return preParams;
}

/**
 * 分享链接
 *
 * 书旗Android、书旗iOS、天猫Android、天猫iOS、支付宝小程序、淘宝小程序
 *
 * @return {Promise<void>}
 *
 * @example
 * const params = {
 *   shareUrl: 'http://www.baidu.com', // 必填。分享的url
 *   shareTitle: '分享标题', // 必填。分享的title
 *   shareContent: '分享内容', // 必填。分享的content
 *   imgUrl: '', // 可选。小图片url
 *   platform: '', // 可选。不传则弹出分享平台弹窗。（可选分享的平台：qq，qzone，wx，circle，sina，more）
 *   shareFrom: '', // 可选。分享来源。主要用于打点统计
 * };
 * libSQ.exec('share-url', { params }).catch((err) => {
 *   alert(`[share-url][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });
 */
export const shareUrl = generateAPI({
  wv: {
    ios: {
      className: WV_CLS_IOS_BASE_UI,
      methodName: 'openAppSendShareData',
      preParam: preParamsWv,
    },
    ios_tmReader: {
      className: WV_CLS_TMIOS_NAVIGATOR,
      methodName: 'shareData',
      preParam: preParamsWv,
    },
    android_tmReader: {// windwane android 调用方式和非windwane一样，对象.call方法
      bridgeName: 'shareData',
      preParam: preParamsWv,
    },
  },
  miniProgram: {
    tb_tmReader: {// 淘宝小程序
      methodName: 'postMessage',
      preParam: preParamMiNi_TMReader,
    },
    aliPay_sqReader: {// 支付宝小程序
      methodName: 'postMessage',
      preParam: preParamMiNi_SQReader,
    },
  },
  ios: {
    bridgeName: 'exec',
    preParam: preParamSQIOS,
  },
  android: {
    bridgeName: 'exec',
    preParam: preParamSQAndroid,
  },
});

