/**
 * 显示端的dialog
 *
 * @author liyizhe
 * @date 2019.04.18
 */

import { dispatchAsEvent } from '../utils/events';
import { generateAPI } from '../utils/generate-api';
import { GLOBAL_CALLBACK_PREFIX, GLOBAL_CALLBACK_SET } from '../constants';
import { warn } from '../utils/log';

/**
 * 内部事件名
 *
 * @type {string}
 */
const EVT_NAME = 'showDialog';

/**
 * 本 API 的全局回调名
 * @type {string}
 */
const CB_NAME = `${GLOBAL_CALLBACK_PREFIX}show-dialog`;

/**
 * 需要等待回调的任务队列
 *
 * @type {Array<function>}
 */
const pendingTasks = [];

/**
 * 本 API 的全局。主要接受书旗android的回调
 *
 * @returns {Promise<void>}
 */
window[GLOBAL_CALLBACK_SET][CB_NAME] = async function (result) {
  try {
    result = JSON.parse(result);
    await dispatchAsEvent(EVT_NAME, result);
  } catch (e) {
    warn(e);
  }
};

/**
 * 接受以上书旗android来的event
 */
document.addEventListener(EVT_NAME, (evt) => {
  pendingTasks.forEach((fn) => {
    try {
      fn(evt.detail);
    } catch (e) {
      warn(e);
    }
  });
  pendingTasks.splice(0, pendingTasks.length);
});

// /**
//  * 支付宝小程序的回调
//  * @returns {Promise}
//  */
// document.addEventListener(MINI_ALIPAY_EVENT, (evt) => {
//   const { detail } = evt || {};
//   if (detail.event === 'getTaobaoId') {
//     pendingTasks.forEach((fn) => {
//       try {
//         fn(detail.data);
//       } catch (e) {
//         warn(e);
//       }
//     });
//     pendingTasks.splice(0, pendingTasks.length);
//   }
// });

/**
 * 将需要等待回调的任务添加到任务队列
 *
 * @returns {Promise<*>}
 */
async function addPendingTask() {
  return new Promise((resolve) => {
    pendingTasks.push((data) => {
      resolve(data);
    });
  });
}

async function postResult() {
  return addPendingTask();
}

/**
 * 书旗android
 * @param params
 * style："1"普通弹框，"2"大图弹框
 * image：大图弹框的图
 * title：普通弹框的标题
 * content：普通弹框的内容
 * okButton：普通弹框的确认按钮
 * cancelButton：普通弹框的取消按钮
 *
 * @returns {Promise.<[string,string,null,string]>}
 */
async function preParamSQAnd(params = {}) {
  return ['ui', 'showDialog', params, `window["${GLOBAL_CALLBACK_SET}"]["${CB_NAME}"]`];
}

// /**
//  * 支付宝小程序入参
//  */
// async function preParamMiNi_AliPay() {
//   const preParams = {
//     event: 'getTaobaoId',
//   };
//   return preParams;
// }

/**
 * 显示对话框
 *
 * 支持平台：书旗Android
 *
 * @return {Promise.<void>}
 *
 * @example
 * const params = {
 *   style: '1',
 *   title: '标题',
 *   content: '我是内容',
 *   okButton: '确定啦',
 *   cancelButton: '取消啦',
 * };
 * // const params = {
 * //   style: '2',
 * //   image: 'http://hellorfimg.zcool.cn/preview/293300162.jpg',
 * // };
 *
 * libSQ.exec('show-dialog', {
 *   params,
 * }).then((info) => {
 *   alert(`[show-dialog][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[show-dialog][error] ${JSON.stringify(err, null, 2)}`);
 * });
 */
export const showDialog = generateAPI({
  android: {
    preParam: preParamSQAnd,
    bridgeName: 'exec',
    postResult,
  },
});

