import {
  getGlobalEnv,
  getGlobalLib,
  initGlobalEvents,
} from './utils/global';
import { flushCMDs } from './utils/exec';
import { dispatchAsEvent } from './utils/events';
import {
  EVT_READY,
  GLOBAL_LIB_NAME, GLOBAL_READY_HOOK_NAME,
} from './constants';
import { isUndefined } from './utils/is-a';

function provideSyncLib() {
  window[GLOBAL_LIB_NAME] = window[GLOBAL_LIB_NAME] || [];
  const lib = window[GLOBAL_LIB_NAME];
  lib.exec = function execPush(cmdName, cmdParams = {}) {
    return new Promise((resolve, reject) => {
      if (isUndefined(cmdParams.success)) {
        cmdParams.success = resolve;
      }
      if (isUndefined(cmdParams.error)) {
        cmdParams.error = reject;
      }
      lib.push([cmdName, cmdParams]);
    });
  };
}

function provideReadyHook() {
  window[GLOBAL_READY_HOOK_NAME] = new Promise((resolve) => {
    document.addEventListener(EVT_READY, (evt) => {
      const { lib } = evt.detail;
      resolve(lib);
    });
  });
}

/**
 * 启动 JS SDK
 *
 * 1. 提供全局同步调用方法
 * 1. 初始化全局环境识别（基于 UserAgent），见 {@link bootstrapGlobalEnv}。
 * 1. 初始化 JS SDK 本体，见 {@link bootstrapGlobalLib}。
 * 1. 初始化全局事件通知机制，见 {@link initGlobalEvents}。
 * 1. 并发执行数组中已经存在的指令 FIFO
 * 1. 触发 ready 事件
 */
export async function bootstrap() {
  provideSyncLib();
  provideReadyHook();
  await getGlobalEnv();
  const lib = await getGlobalLib();
  await initGlobalEvents();
  await flushCMDs();
  await dispatchAsEvent(EVT_READY, {
    lib,
  });
}

