/**
 * 错误常量前缀
 * @type {string}
 */
const ERR_PREFIX = 'ERR_';
/**
 * UserAgent 类错误常量前缀
 * @type {string}
 */
const ERR_UA_PREFIX = `${ERR_PREFIX}UA_`;
/**
 * API 类错误常量前缀
 * @type {string}
 */
const ERR_API_PREFIX = `${ERR_PREFIX}API_`;

/**
 * JS SDK 内部错误常量的基本格式
 *
 * @typedef {Object} ErrorConstant
 * @property {string} code - 错误码
 * @property {string} [message] - 错误信息
 * @property {Object} [detail] - 错误详情
 */

/**
 * 错误 - 非法 UserAgent
 * @type {ErrorConstant}
 */
export const ERR_INVALID_UA = {
  code: `${ERR_UA_PREFIX}1`,
  message: 'Invalid UserAgent',
};

/**
 * 错误 - 未知错误
 * @type {ErrorConstant}
 */
export const ERR_UNKNOWN = {
  code: `${ERR_PREFIX}0`,
  message: 'Unknown Error',
};

/**
 * 错误 - API 不可用
 * @type {ErrorConstant}
 */
export const ERR_API_UNAVAILABLE = {
  code: `${ERR_API_PREFIX}1`,
  message: 'API unavailable',
};

/**
 * 错误 - API 超时
 * @type {ErrorConstant}
 */
export const ERR_API_TIMEOUT = {
  code: `${ERR_API_PREFIX}2`,
  message: 'API timeout',
};

/**
 * 错误 - 传参错误
