 * @property {ErrorConstant} HY_NO_HANDLER - 表示当前客户端没有提供这个 API，
 * 请检查调用的 JSBridge 是否正确，并联系 JSBridge 的 Native 提供方排查。
 * @property {ErrorConstant} HY_PARAM_ERR - 表示传入的参数错误，请检查传入的参数是否有误。
 * @property {ErrorConstant} HY_NO_PERMISSION - 表示当前页面没有权限调用这个接口，请联系 WindVane @炼玉。
 * @property {ErrorConstant} HY_FAILED - 表示 API 执行失败了，请联系 JSBridge 的 Native 提供方排查。
 * @property {ErrorConstant} HY_EXCEPTION - 表示 API 执行时发生了异常，请联系 JSBridge 的 Native 提供方排查。
 * @property {ErrorConstant} HY_USER_DENIED - 表示当前 API 缺少用户授权，例如需要访问相册的接口，但用户并未允许客户端访问相册。
 * @property {ErrorConstant} HY_USER_CANCELLED - 表示用户主动取消了当前 API 的功能执行。
 * @property {ErrorConstant} HY_RET_PHOTO_CANCLE - 表示使用 WVCamera 提供的接口拍照时，被用户取消。
 * @property {ErrorConstant} HY_TIMEOUT - 表示 JSBridge 调用超时。
 * @property {ErrorConstant} HY_RESULT_PARSE_ERROR - 表示 Native 传递给 H5 的数据出现格式错误，
