}

import { isUndefined } from './is-a';
import { generateSDKError } from './generate-sdk-error';
import { delayedGetLegacyBridge } from './exec';
import { log } from './log';

/**
 * 全局环境中的状态值
 *
 * @typedef {Object} Environment
 * @property {boolean} isSQReader - 是否在书旗应用中
 * @property {boolean} isAndroid - 是否为 Android 设备
 * @property {boolean} isIOS - 是否为 iOS 设备
 * @property {boolean} isInWV - 是否在 WindVane 应用中
 * @property {boolean} isTMReader - 是否在 天猫读书 应用中
 * @property {boolean} isMiNi_TB_tmReader, 在淘宝小程序
 * @property {boolean} isMiNi_AliPay_sqReader,在书旗小程序
 * @property {boolean} [isReady] - 环境是否检测完成 {@link INTERNAL_IS_ENV_READY}
 */

/**
 * 检测当前运行环境
 *
 * @param {Object} [env] 用来初始化的环境对象
 * @return {Promise<Environment>} 当前环境参数
 * @todo 使用 WindVane API 检测 WindVane 信息（客户端不支持，先不做）
 * 相关文档：http://h5.alibaba-inc.com/api/WindVane-API.html#Base-isWindVaneSDK
 */
export async function detectEnv(env) {
  if (isUndefined(env)) {
    env = {};
  }

  const { userAgent } = navigator;

  if (!userAgent) {
    throw generateSDKError('ERR_INVALID_UA');
  }

  const isWindowsPhone = /Windows Phone/gi.test(userAgent);
  const isIOS = /ip(ad|hone|od)/gi.test(userAgent) && !isWindowsPhone;
  const isAndroid = /android/gi.test(userAgent) && !isIOS && !isWindowsPhone;
  const isSQReader = /(SQREADER|Shuqi)/gi.test(userAgent);
  const isTMReader = /TMREADER/gi.test(userAgent);

  env.isAndroid = isAndroid;
  env.isIOS = isIOS;
  env.isInWV = /windvane/gi.test(userAgent);
  env.isSQReader = isSQReader;
  env.isTMReader = isTMReader;
  env.isMiNi_TB_tmReader = /TB|tmall/gi.test(userAgent);
  env.isMiNi_AliPay_sqReader = /AlipayClient/gi.test(userAgent);

  return adjustEnvForOldIOSClient(env);
}

async function adjustEnvForOldIOSClient(env) {
  // 此处应该是iOS桥，在老的工程内，userAgent内没有写自定也userAgent
  if (env.isIOS && !env.isSQReader && !env.isTMReader && !env.isMiNi_TB_tmReader && !env.isMiNi_AliPay_sqReader) {
    let bridge;
    try {
      bridge = await delayedGetLegacyBridge();
      if (bridge) {
        env.isSQReader = true;
      }
    } catch (e) {
      log(e);
    }
  }

  return env;
}

import {
  CLIENT_EVENT,
  INTERNAL_CLIENT_EVENT,
} from '../../constants';
import {
  isFunction,
  isObject,
} from '../is-a';
import { warn } from '../log';

/**
 * 绑定事件至指定 DOM 元素
 *
 * @param {string} [eventName=INTERNAL_CLIENT_EVENT] 事件名，默认为{@link INTERNAL_CLIENT_EVENT}
 * @param  {Function} [eventHandler=()=>{}] 事件处理函数
 * @param  {HTMLElement} [eventTarget=document] DOM 元素
 * @return {Function}
 */
export function bindEvent(
  eventName = INTERNAL_CLIENT_EVENT,
  eventHandler,
  eventTarget = document) {
  if (!isFunction(eventHandler)) {
    return () => {}; // noop
  }

  try {
    eventTarget.addEventListener(eventName, eventHandler);
  } catch (e) {
    warn(e);
  }

  return () => {
    try {
      eventTarget.removeEventListener(eventName, eventHandler);
    } catch (e) {
      warn(e);
    }
  };
}

/**
 * 解除绑定事件至指定 DOM 元素
 *
 * @param {string} [eventName=INTERNAL_CLIENT_EVENT] 事件名，默认为{@link INTERNAL_CLIENT_EVENT}
 * @param  {Function} eventHandler 事件处理函数
 * @param  {HTMLElement} [eventTarget=document] DOM 元素
 * @return {boolean} 是否解除绑定成功
 */
export function unbindEvent(
  eventName = INTERNAL_CLIENT_EVENT,
  eventHandler,
  eventTarget = document) {
  let result = false;

  if (!isFunction(eventHandler)) {
    return result;
  }

  try {
    eventTarget.removeEventListener(eventName, eventHandler);
    result = true;
  } catch (e) {
    warn(e);
  }

  return result;
}

/**
 * 生成 `CustomEvent`，包含无 `CustomEvent` constructor 兼容
 *
 * @param {string} eventName 事件名
 * @param {Object} [payload={}] `detail` 里的数据
 * @return {CustomEvent} 生成的 `CustomEvent`
 */
export function buildEvent(eventName, payload = {}) {
  let event = null;

  try {
    event = new CustomEvent(eventName, { detail: payload });
  } catch (e) {
    warn(e); // ignore
  }

  if (!event) { // 兼容低端机
    event = document.createEvent('CustomEvent');
    event.initCustomEvent(eventName, true, true, payload);
  }

  return event;
}

/**
 * 发出事件
 *
 * @param {CustomEvent} event 发出的事件
 * @param {EventTarget} [eventTarget=document] 发出事件的 DOM 元素，默认 `document`
 * @return {Promise<boolean>} 事件是否被取消，同 `EventTarget.dispatchEvent` @see https://developer.mozilla.org/en-US/docs/Web/API/EventTarget/dispatchEvent
 */
export async function dispatchEvent(event, eventTarget = document) {
  return new Promise((resolve) => {
    // 减小 call stack
    setTimeout(() => {
      resolve(eventTarget.dispatchEvent(event));
    });
  });
}

/**
 * 创建事件并发送
 *
 * @param {string} eventName 事件名
 * @param {Object} [payload={}] `detail` 里的数据
 * @param {EventTarget} [eventTarget=document] 发出事件的 DOM 元素，默认 `document`
 * @returns {Promise<boolean>} 事件是否被取消，同 {@link dispatchEvent}
 */
export async function dispatchAsEvent(eventName, payload = {}, eventTarget = document) {
  const event = buildEvent(eventName, payload);
  return dispatchEvent(event, eventTarget);
}

/**
 * 解析 `clientEvent`，根据与客户端的约定，传递过来的事件参数是在 data 的 param 属性中。
 * @example
 * document.addEventListener('clientEvent', (data) => {
 *    alert( JSON.stringify(data, null, 2) );
 *    // data.param = {
 *    //     event: 'eventName',
 *    //     data: {},
 *    // }
 *
 *    const parsed = parseClientEvent(data);
 *
 *    // parsed = {
 *    //     eventName: 'eventName',
 *    //     eventData: {},
 *    // }
 * });
 * @param {Object} event - 从客户端传递来的事件
 * @param {Object} event.param - 客户端事件内容的封装
 * @param {string} event.param.event - 客户端事件的服务名
 * @param {*} [event.param.data] - 事件的 payload
 *
 * @return {(Object|null)} - 解析出来的事件信息
 * @property {string} eventName - 解析出来的事件名
 * @property {*} [eventData] - 解析出来的事件 payload
 */
export function parseClientEvent(event) {
  if (event && event.param && isObject(event.param)) {
    const {
      event: eventName,
      data: eventData,
    } = event.param;

    return {
      eventName,
      eventData,
    };
  }

  return null;
}

/**
 * 解析并转发从客户端发来的事件
 * @param event {Event}
 */
export function clientEventDispatcher(event) {
  if (!event) {
    return; // ignore
  }

  let eventData = event;

  // 兼容使用原生事件的触发
  if (event.type === CLIENT_EVENT) {
    if (event instanceof Event && isObject(event.detail)) {
      eventData = event.detail;
    }
  }

  if (eventData) {
    const parsedEvent = parseClientEvent(eventData);
    if (parsedEvent) {
      dispatchAsEvent(parsedEvent.eventName, parsedEvent.eventData)
        .catch((e) => {
          warn(e); // ignore
        });
    }
  }
}

