import { log, warn } from '../log';
import {
  BRIDGE_NAME_LEGACY,
  BRIDGE_NAME_LEGACY_TMREADER,
  BRIDGE_REQUEST_DELAY,
  BRIDGE_REQUEST_TIMEOUT,
  DEFAULT_API_TIMEOUT,
  ERR_API_UNKNOWN,
  INTERNAL_API_SUPPORTS,
  INTERNAL_RAW_ERROR,
  SUPPORT_ANDROID,
  SUPPORT_IOS,
  SUPPORT_WINDVANE,
  SUPPORT_WINDVANE_ANDROID,
  SUPPORT_WINDVANE_IOS,
  WV_ERRORS_TO_INTERNAL_MAP,
  SUPPORT_WINDVANE_IOS_TMREADER,
  SUPPORT_WINDVANE_ANDROID_TMREADER,
  SUPPORT_MINIPROGRAM_TB_TMREADER,
  SUPPORT_MINIPROGRAM_ALIPAY_SQREADER,
} from '../../constants';
import * as cmds from '../../constants/cmds';
import { getGlobalEnv, getGlobalLib } from '../global';
import { isFunction, isString, isObject } from '../is-a';
import { cloneJSON } from '../clone-json';
import { generateSDKError } from '../generate-sdk-error';

/**
 * 根据指令名称，查找指令
 *
 * @param {string} cmdName - 指令名
 * @returns {(Promise<Command>|Promise<null>)} - 查找到的指令，查找不到返回 `null`
 */
export async function getApiByCMDName(cmdName) {
  const commands = Object.keys(cmds);

  let eCmd;

  for (let i = commands.length - 1; i >= 0; i--) {
    eCmd = cmds[commands[i]];
    if (cmdName === eCmd.name) {
      return eCmd;
    }
  }

  return null;
}

/**
 *
 * @param {Command} cmd - 查找到的指令，查找不到返回 `null`
 * @returns {Promise<void>}
 */
export async function isCMDSupported(cmd = {}) {
  const api = await cmd.api;
  if (!isFunction(api)) {
    return false;
  }

  const env = await getGlobalEnv();
  const {
    isSQReader,
    isAndroid,
    isIOS,
    isInWV,
    isTMReader,
    isMiNi_TB_tmReader,
    isMiNi_AliPay_sqReader,
  } = env;

  const supportsMap = {
    [SUPPORT_IOS]: isSQReader && isIOS, // 书旗iOS
    [SUPPORT_ANDROID]: isSQReader && isAndroid, // 书旗android
    [SUPPORT_WINDVANE]: isInWV,
    [SUPPORT_WINDVANE_ANDROID]: isSQReader && isAndroid && isInWV, // 书旗windvane
    [SUPPORT_WINDVANE_IOS]: isSQReader && isIOS && isInWV, // 书旗windvane
    [SUPPORT_WINDVANE_IOS_TMREADER]: isTMReader && isIOS && isInWV,
    [SUPPORT_WINDVANE_ANDROID_TMREADER]: isTMReader && isAndroid && isInWV,
    [SUPPORT_MINIPROGRAM_TB_TMREADER]: isMiNi_TB_tmReader,
    [SUPPORT_MINIPROGRAM_ALIPAY_SQREADER]: isMiNi_AliPay_sqReader,
  };

  const { [INTERNAL_API_SUPPORTS]: supports = [] } = api;
  let isSupported = false;

  for (let i = supports.length - 1; i >= 0; i--) {
    if (supportsMap[supports[i]]) {
      isSupported = true;
      break;
    }
  }

  log(`[isCMDSupported] isSupported: ${isSupported}`, cmd);
  return isSupported;
}

/**
 * 执行命令
 *
 * @param {string} cmdName 指令名
 * @param {Object} [cmdParams={}] 指令参数
 * @param {Object} [cmdParams.params={}] 传递给底层 API 的调用参数
 * @param {function} [cmdParams.success] 调用 API 成功时的回调，同 `Promise` 形式的 `then`，建议只在使用数组形式接口时使用。
 * @param {function} [cmdParams.error] 调用 API 失败时的回调，同 `Promise` 形式的 `catch`，建议只在使用数组形式接口时使用。
 * @param {function} [cmdParams.callback] API 实现的功能所需要的系统回调，建议只在非 `WindVane` 模式下使用，
 * `WindVane` 环境下会触发消息事件
 *
 * @todo 写文档
 */
export async function exec(cmdName, cmdParams = {}) {
  log(`[exec] ${cmdName}:`, cmdParams);

  const { params, success, error, callback } = cmdParams;

  const cmd = await getApiByCMDName(cmdName);

  if (cmd && await isCMDSupported(cmd)) {
    const onSuccess = async (result) => {
      if (isFunction(success)) {
        return success(result);
      }

      return result;
    };
    const onError = async (err) => {
      if (isFunction(error)) {
        return error(err);
      }

      throw err;
    };

    try {
      const api = await cmd.api;
      return onSuccess(api(params, callback));
    } catch (e) {
      let err = e;
      if (!err || !isObject(err.detail)) {
        err = generateSDKError('ERR_API_UNKNOWN');
        err.detail = {
          [INTERNAL_RAW_ERROR]: e,
        };
      }

      err.detail.cmdName = cmdName;
      err.detail.cmdParams = cmdParams;

      return onError(err);
    }
  }
  const noAPIError = generateSDKError('ERR_API_UNAVAILABLE');

  noAPIError.detail = {
    cmdName,
    cmdParams,
  };

  throw noAPIError;
}

/**
 * 获取客户端桥，书旗：anShuqiForSqWebJS。天猫android：tbreader
 *
 * @returns {Promise<Object>} 旧客户端桥
 * @todo 写文档
 */
export async function getLegacyBridge() {
  const env = await getGlobalEnv();

  if (env.isTMReader && BRIDGE_NAME_LEGACY_TMREADER in window) { // 天猫读书客户端的js对象
    return window[BRIDGE_NAME_LEGACY_TMREADER];
  } else if (env.isSQReader && BRIDGE_NAME_LEGACY in window) { // 书旗客户端的js对象
    return window[BRIDGE_NAME_LEGACY];
  } else if (!env.isSQReader && !(env.isTMReader)) { // 暂时这么改，还需考虑小程序
    return null;
  } else {
    return delayedGetLegacyBridge();
  }
}

/**
 * 延迟轮询获取桥对象
 * @returns {Promise.<*>}
 */
let count = 0;
export async function delayedGetLegacyBridge() {
  const env = await getGlobalEnv();
  if (env.isTMReader && BRIDGE_NAME_LEGACY_TMREADER in window) {
    delayedGetLegacyBridge.__$startTime__ = 0;
    return window[BRIDGE_NAME_LEGACY_TMREADER];
  } else if (env.isSQReader && BRIDGE_NAME_LEGACY in window) {
    delayedGetLegacyBridge.__$startTime__ = 0;
    return window[BRIDGE_NAME_LEGACY];
  } else {
    const now = Date.now();
    delayedGetLegacyBridge.__$startTime__ = delayedGetLegacyBridge.__$startTime__ || now;
    return new Promise((resolve, reject) => {
      if (Math.abs(now - delayedGetLegacyBridge.__$startTime__) >= BRIDGE_REQUEST_TIMEOUT) {
        const apiTimeOutError = generateSDKError('ERR_API_TIMEOUT');

        apiTimeOutError.detail = {
          from: 'delayedGetLegacyBridge',
        };

        delayedGetLegacyBridge.__$startTime__ = 0;
        reject(apiTimeOutError);
      } else {
        setTimeout(() => {
          resolve();
        }, BRIDGE_REQUEST_DELAY);
      }
    }).then(() => {
      if (count < 3) {
        /* eslint-disable no-unused-expressions */
        delayedGetLegacyBridge;
        count += 1;
        /* eslint-disable no-unused-expressions */
      }
    });
  }
}

/**
 * 调用旧客户端桥，对象.call方法，android windwane也是这样调用
 * @todo 写文档
 */
export async function execLegacy(methodName, ...params) {
  const env = await getGlobalEnv();

  log(`[execLegacy] ${methodName}: `, params);

  const noAPIError = generateSDKError('ERR_API_UNAVAILABLE');

  noAPIError.detail = {
    methodName,
    params,
  };
  if (env.isSQReader || env.isTMReader) { // 暂时这么改，还需考虑小程序
    return getLegacyBridge().then((bridge) => {
      if (bridge == null || !(methodName in bridge)) {
        throw noAPIError;
      } else {
        let p;
        for (let i = 0, l = params.length; i < l; i++) {
          p = params[i];
          if (isObject(p)) {
            params[i] = JSON.stringify(p);
          }
        }
        // alert(`${methodName}: ${JSON.stringify(params, null, 2)}`);
        return bridge[methodName].call(bridge, ...params);
      }
    }).catch((e) => {
      let err = e;
      if (!err || !isObject(err.detail)) {
        err = generateSDKError('ERR_API_UNKNOWN');
        err.detail = {
          [INTERNAL_RAW_ERROR]: e,
        };
      }

      err.detail.methodName = methodName;
      err.detail.params = params;

      throw err;
    });
  } else {
    throw noAPIError;
  }
}

/**
 * 调用 WindVane，使用以下方式来调用客户端提供的功能：
 * `window.WindVane.call(className, methodName, params, successCallback, failureCallback, timeout)`
 *
 * 在支持 Promise 的环境下，不添加 successCallback 和 failureCallback 时，返回 Promise，所以封装时，
 * 不传入 successCallback 和 failureCallback
 *
 * @doc http://h5.alibaba-inc.com/windvane/UseJSBridge.html
 * @todo 写文档
 */
export async function execWV({
  className = 'Base',
  methodName,
  params = {},
  timeout = DEFAULT_API_TIMEOUT,
}) {
  // alert(`${className} | ${methodName}: ${JSON.stringify(params, null, 2)}`);
  return window.WindVane.call(className, methodName, params, null, null, timeout).catch((e) => {
    const err = cloneJSON(WV_ERRORS_TO_INTERNAL_MAP[e && e.ret] || ERR_API_UNKNOWN);

    err.detail = {
      [INTERNAL_RAW_ERROR]: e,
      methodName,
      params,
    };

    throw err;
  });
}

/**
 * 处理小程序的桥
 * @param methodName
 * @param params
 * @returns {Promise.<void>}
 */
export async function execMiNi({
  methodName,
  params = {},
  // timeout = DEFAULT_API_TIMEOUT,
}) {
  const noAPIError = generateSDKError('ERR_API_UNAVAILABLE');

  noAPIError.detail = {
    methodName,
    params,
  };
  /* eslint-disable no-undef */
  if (typeof my === 'undefined') {
    throw noAPIError;
  } else {
    let p;
    for (let i = 0, l = params.length; i < l; i++) {
      p = params[i];
      if (isObject(p)) {
        params[i] = JSON.stringify(p);
      }
    }
    return my[methodName].call(my, params);
    // alert(`${methodName}: ${JSON.stringify(params, null, 2)}`);
    // return bridge[methodName].call(bridge, ...params);
  }
  /* eslint-disable no-undef */
}

/**
 * 执行全局队列中的待执行指令，直接并发执行。
 *
 * @returns {Promise<void>}
 */
export async function flushCMDs() {
  const queue = await getGlobalLib();

  queue.forEach((cmd) => {
    setTimeout(async () => {
      try {
        await exec(...cmd);
      } catch (e) {
        warn('[flushCMDs][error]: ', e);
      }
    });
  });

  queue.splice(0, queue.length);
}

/**
 * 对返回结果的对象的顶级 `key` 进行 `decodeURIComponent`
 *
 * @param result
 */
export function decodeResult(result) {
  const decoded = {};

  for (const k in result) {
    if (Object.prototype.hasOwnProperty.call(result, k)) {
      decoded[k] = decodeURIComponent(result[k]);
    }
  }

  return decoded;
}

/**
 * 对参数的对象的顶级 `key` 进行 `encodeURIComponent`
 *
 * @param params
 */
export function encodeParams(params) {
  const encoded = {};
  let val;

  for (const k in params) {
    if (Object.prototype.hasOwnProperty.call(params, k)) {
      val = params[k];

      if (isString(val)) {
        encoded[k] = encodeURIComponent(val);
      } else {
        encoded[k] = val;
      }
    }
  }

  return encoded;
}

/**
 * 单个环境下的 API 配置
 *
 * @typedef {Object} APIConfig
 * @property {function} preParam - 对传入参数的处理函数
 * @property {function} exec - API 底层执行函数，WindVane 默认使用{@link execWV}，普通 JS 桥默认使用 {@link execLegacy}
 * @property {function} postResult - 对最终结果的处理函数
 * @property {string} [className] - WindVane 调用时需要的 className
 * @property {string} [methodName] - WindVane 调用时需要的 methodName
 * @property {string} [bridgeName] - 普通调用时需要的 JS 桥的名字
 */

/**
 * 多个环境下的 API 配置合集
 *
 * @typedef {Object} APIConfigs
 * @property {Object} wv - WindVane 下的 API 配置合集
 * @property {APIConfig} wv.ios - WindVane 下 iOS 的 API 配置
 * @property {APIConfig} wv.android - WindVane 下 Android 的 API 配置
 * @property {APIConfig} wv.ios_tmReader - 天猫读书 WindVane 下 iOS 的 API 配置
 * @property {APIConfig} wv.android_tmReader - 天猫读书 WindVane 下 Android 的 API 配置
 * @property {APIConfig} android - Android 的 API 配置
 * @property {APIConfig} ios - iOS 的 API 配置
 * @property {Object} miniProgram - 小程序 下的 API 配置合集
 * @property {APIConfig} miniProgram.tb_tmReader - 小程序 下的 API 配置合集
 * @property {APIConfig} miniProgram.aliPay_sqReader - 小程序 下的 API 配置合集
 */

import {
  INTERNAL_API_SUPPORTS,
  INTERNAL_RAW_ERROR,
  SUPPORT_ANDROID,
  SUPPORT_IOS,
  SUPPORT_WINDVANE_ANDROID,
  SUPPORT_WINDVANE_IOS,
  WV_SUCCESS_CODES,
  SUPPORT_WINDVANE_IOS_TMREADER,
  SUPPORT_WINDVANE_ANDROID_TMREADER,
  SUPPORT_MINIPROGRAM_TB_TMREADER,
  SUPPORT_MINIPROGRAM_ALIPAY_SQREADER,
  MINI_ALIPAY_EVENT,
} from '../constants';
import { getGlobalEnv } from './global';
import { unifiedErrorHandler } from './unified-error-hander';
import { execLegacy, execWV, execMiNi } from './exec';
import { isUndefined, isFunction } from './is-a';
import { generateSDKError } from './generate-sdk-error';
import { dispatchAsEvent } from './events';
import { warn } from './log';

/**
 * 生成 API
 *
 * @param {APIConfigs} apiConfigs - 多环境下的 API 配置合集，根据传入的 key，自动添加 supports
 * @returns {Promise<void>}
 */
export async function generateAPI(apiConfigs) {
  const { wv = {}, android, ios, miniProgram = {} } = apiConfigs;
  const wvIOS = wv.ios; // iOS
  const wvAndroid = wv.android; // android
  const wvIOS_tmReader = wv.ios_tmReader;// 天猫读书iOS
  const wvAndroid_tmReader = wv.android_tmReader;// 天猫读书android
  const miniTMReader = miniProgram.tb_tmReader; // 天猫小程序
  const miniSQReader = miniProgram.aliPay_sqReader;// AliPay 小程序
  const supports = [];

  if (android) {
    supports.push(SUPPORT_ANDROID);
  }
  if (ios) {
    supports.push(SUPPORT_IOS);
  }
  if (wvIOS) {
    supports.push(SUPPORT_WINDVANE_IOS);
  }
  if (wvAndroid) {
    supports.push(SUPPORT_WINDVANE_ANDROID);
  }
  if (wvIOS_tmReader) {
    supports.push(SUPPORT_WINDVANE_IOS_TMREADER);
  }
  if (wvAndroid_tmReader) {
    supports.push(SUPPORT_WINDVANE_ANDROID_TMREADER);
  }
  if (miniTMReader) {
    supports.push(SUPPORT_MINIPROGRAM_TB_TMREADER);
  }
  if (miniSQReader) {
    supports.push(SUPPORT_MINIPROGRAM_ALIPAY_SQREADER);
  }

  const apiFn = async function _apiFn(params = {}) {
    const env = await getGlobalEnv();

    if (env.isSQReader) { // 书旗客户端相关
      if (env.isIOS) {
        if (env.isInWV && wvIOS) {
          return wvWrapper(env, wvIOS, params);
        } else if (ios) {
          return legacyWrapper(env, ios, params);
        }
      } else if (env.isAndroid) {
        if (env.isInWV && wvAndroid) {
          return wvWrapper(env, wvAndroid, params);
        } else if (android) {
          return legacyWrapper(env, android, params);
        }
      }
    } else if (env.isTMReader) { // 天猫客户端相关，天猫读书都是windwane
      if (env.isIOS && wvIOS_tmReader) {
        return wvWrapper(env, wvIOS_tmReader, params);
      } else if (env.isAndroid && wvAndroid_tmReader) {
        // tm android windwane的方式和sq android非windwane调用方式相同，都是对象找方法
        return legacyWrapper(env, wvAndroid_tmReader, params);
      }
    } else if (env.isMiNi_TB_tmReader) { // 天猫小程序相关
      return miniWrapper(env, miniTMReader, params);
    } else if (env.isMiNi_AliPay_sqReader) { // 书旗小程序相关
      return miniWrapper(env, miniSQReader, params);
    }

    throw generateSDKError('ERR_API_UNAVAILABLE');
  };
  apiFn[INTERNAL_API_SUPPORTS] = supports;
  return apiFn;
}

/**
 * 真正的桥的调用
 * @param env
 * @param config
 * @param params
 * @returns {Promise.<*>}
 */
async function genericLifeCycle(env, config, params = {}) {
  let { preParam, exec, postResult } = config;

  if (!isFunction(preParam)) {
    preParam = async p => [p];
  }
  if (!isFunction(postResult)) {
    postResult = async r => r;
  }
  if (!isFunction(exec)) {
    if (env.isMiNi_TB_tmReader || env.isMiNi_AliPay_sqReader) {
      exec = execMiNi;
    } else if (env.isInWV) {
      exec = execWV;
    } else if (env.isAndroid || env.isIOS) {
      exec = execLegacy;
    }
  }

  // 准备入参,调用桥
  const preProcessedParam = await preParam(params);
  const result = await unifiedErrorHandler(exec, ...preProcessedParam);
  return postResult(result, params);
}

/**
 * ios windwane调用的桥
 * @param env
 * @param config
 * @param params
 * @returns {Promise}
 */
async function wvWrapper(env, config, params = {}) {
  let { preParam, postResult } = config;
  const { exec, className, methodName } = config;

  // TODO validation
  // className, methodName

  if (!isFunction(preParam)) {
    preParam = async p => p;
  }

  if (!isFunction(postResult)) {
    postResult = async r => r;
  }

  return genericLifeCycle(env, {
    preParam: async (p) => {
      const preProcessedParam = await preParam(p);
      return [{
        className,
        methodName,
        params: preProcessedParam,
        timeout: params.timeout,
      }];
    },
    exec,
    postResult: async (r, p) => {
      if (r && WV_SUCCESS_CODES.indexOf(r.ret) !== -1) {
        if (isUndefined(r.data)) {
          return postResult(r, p);
        } else {
          return postResult(r.data, p);
        }
      }
      const err = generateSDKError('ERR_API_UNKNOWN');
      err.detail = {
        [INTERNAL_RAW_ERROR]: r,
      };

      throw err;
    },
  },
  params);
}

