import { generateSDKError } from './generate-sdk-error';
import { isObject } from './is-a';
import { INTERNAL_RAW_ERROR } from '../constants';

/**
 * 执行函数后，统一处理函数出错，封装成内部错误
 *
 * @param {function} executable - 可执行函数
 * @param {*} params - 传递的参数
 * @returns {Promise<*>} - 返回的结果
 * @example
 * const wvResult = await unifiedErrorHandler('execWV', {
 *    className: WV_CLS_IOS_ENV,
 *    methodName: 'getAppInfo',
 * });
 */
export async function unifiedErrorHandler(executable, ...params) {
  if (!executable) {
    throw generateSDKError('ERR_API_UNKNOWN');
  }

  let result;
  let error;

  try {
    result = await executable(...params);
  } catch (e) {
    if (!e) {
      throw generateSDKError('ERR_API_UNKNOWN');
    }
    error = e;
  }

  if (error) {
    if (isObject(error.detail)) {
      throw error;
    }

    const err = generateSDKError('ERR_API_UNKNOWN');
    err.detail = {
      [INTERNAL_RAW_ERROR]: error,
    };

    throw err;
  }

  return result;
}

