1. `npm run gen:doc` - 生成文档至 `docs/`
1. `npm run serve:doc` - 启动 web 服务，供查看生成的文档 `docs/`
1. `npm run serve:demo` - 启动 web 服务，供查看 `demo/`（实际是以 `lib-shuqi-js/` 为 web 服务文件夹）
1. `npm run serve:coverage` - 启动 web 服务，供查看生成的单元测试覆盖率文档 `coverage/`
1. `npm run lint` - 执行 `eslint`
1. `npm run lint:fix` - 执行 `eslint --fix`
1. `npm test` - 执行单元测试，主要供自动化时使用，仅生成 html 格式的覆盖率文档，不展示文本结果统计
1. `npm run test:man` - 执行单元测试，主要供研发时使用，生成 html 格式的覆盖率文档时，展示文本结果统计
1. `npm run hook:pre-commit` - 在 `git commit` 时会被 `husky` 执行的 `pre-commit` hook
1. `npm run release` - 编译 `development` 和 `production` 版本，并生成文档

import { expect } from 'chai';
import {
  GLOBAL_ENV_NAME,
  GLOBAL_LIB_NAME,
  INTERNAL_IS_LIB_READY,
} from '../src/constants';
import { bootstrap } from '../src/bootstrap';

/**
 * 初始化函数
 * @test {utils}
 */
describe('bootstrap', () => {
  /**
   * 启动后是否正常
   * @test {bootstrap}
   */
  it('启动后的 Ready 状态', async () => {
    await bootstrap();

    expect(window[GLOBAL_ENV_NAME].isReady).to.be.true;
    expect(window[GLOBAL_LIB_NAME][INTERNAL_IS_LIB_READY]).to.be.true;
  });
});

import { expect } from 'chai';
import { stub } from 'sinon';
import { ERR_INVALID_UA } from '../../src/constants';
import { detectEnv } from '../../src/utils/detect-env';

/**
 * 环境检测工具方法
 * @test {detectEnv}
 */
describe('detect-env', () => {
  const UA_EMPTY = '';
  const UA_SHUQI_ANDROID = 'Mozilla/5.0 (Linux; Android 8.1.0; Nexus 5X Build/OPM6.171019.030.E1; wv) AppleWebKit/537.36 (KHTML, like Gecko) Version/4.0 Chrome/67.0.3396.87 Mobile Safari/537.36 Shuqi (LGE-Nexus 5X__shuqi__10.6.4.59__1073)';
  const UA_SHUQI_IOS = 'Mozilla/5.0 (iPhone; CPU iPhone OS 11_2_6 like Mac OS X) AppleWebKit/604.5.6 (KHTML, like Gecko) Mobile/15D100 Shuqi (iPhone9,2__shuqi__v3.9.18.0)';
  const UA_ANDROID = 'Mozilla/5.0 (Linux; Android 8.1.0; Nexus 5X Build/OPM6.171019.030.E1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Mobile Safari/537.36';
  const UA_SHUQI_IOS_WV = `${UA_SHUQI_IOS} WindVane/8.3.0`;
  const UA_SHUQI_ANDROID_WV = `${UA_SHUQI_ANDROID} WindVane/8.3.0`;
  const UA_IOS = 'Mozilla/5.0 (iPhone; CPU iPhone OS 11_2_6 like Mac OS X) AppleWebKit/604.5.6 (KHTML, like Gecko) Version/11.0 Mobile/15D100 Safari/604.1';
  const UA_CHROME_DESKTOP = 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_13_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/68.0.3440.106 Safari/537.36';
  const UA_CHROME_MOBILE = 'Mozilla/5.0 (Linux; Android 8.0.0; Pixel 2 XL Build/OPD1.170816.004) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/68.0.3440.106 Mobile Safari/537.36';
  const UA_TMREADER_ANROID = 'Mozilla/5.0 (Linux; Android 8.1.0; Nexus 5X Build/OPM6.171019.030.E1; wv) AppleWebKit/537.36 (KHTML, like Gecko) Version/4.0 Chrome/67.0.3396.87 Mobile Safari/537.36 AliApp(TMREADER/1.0.6.0) WindVane/8.1.1 softId/2036 appVer/1.0.6.0 placeId/1073';
  const UA_TMREADER_IOS = 'taobaoreader/1.0.2.3 (iPhone; iOS 9.2; Scale/3.00) (appVer/1.0.2.3; placeId/1073; softId/2038; netEnv/unknown) WindVane/8.3.0 1242x2208';

  async function getDetectEnvResult(ua) {
    const s = stub(navigator, 'userAgent').value(ua);
    const env = await detectEnv();
    s.restore();
    return env;
  }

  /**
   * @test {detectEnv}
   */
  it('解析 UA_EMPTY', async () => {
    try {
      const env = await getDetectEnvResult(UA_EMPTY);
      expect(env).to.equal('never run');
    } catch (err) {
      const { code, message } = ERR_INVALID_UA;
      expect(err).to.eql({
        code, message,
      });
    }
  });

  /**
   * @test {detectEnv}
   */
  it('解析 UA_SHUQI_ANDROID', async () => {
    const env = await getDetectEnvResult(UA_SHUQI_ANDROID);

    expect(env).to.include({
      isSQReader: true,
      isAndroid: true,
      isIOS: false,
      isInWV: false,
    });
  });

  /**
   * @test {detectEnv}
   */
  it('解析 UA_SHUQI_IOS', async () => {
    const env = await getDetectEnvResult(UA_SHUQI_IOS);

    expect(env).to.include({
      isSQReader: true,
      isAndroid: false,
      isIOS: true,
      isInWV: false,
    });
  });

  /**
   * @test {detectEnv}
   */
  it('解析 UA_SHUQI_ANDROID_WV', async () => {
    const env = await getDetectEnvResult(UA_SHUQI_ANDROID_WV);

    expect(env).to.include({
      isSQReader: true,
      isAndroid: true,
      isIOS: false,
      isInWV: true,
    });
  });

  /**
   * @test {detectEnv}
   */
  it('解析 UA_SHUQI_IOS_WV', async () => {
    const env = await getDetectEnvResult(UA_SHUQI_IOS_WV);

    expect(env).to.include({
      isSQReader: true,
      isAndroid: false,
      isIOS: true,
      isInWV: true,
    });
  });

  /**
     * @test {detectEnv}
     */
  it('解析 UA_ANDROID', async () => {
    const env = await getDetectEnvResult(UA_ANDROID);

    expect(env).to.include({
      isSQReader: false,
      isAndroid: true,
      isIOS: false,
      isInWV: false,
    });
  });

  /**
     * @test {detectEnv}
     */
  it('解析 UA_IOS', async () => {
    const env = await getDetectEnvResult(UA_IOS);

    expect(env).to.include({
      isSQReader: false,
      isAndroid: false,
      isIOS: true,
      isInWV: false,
    });
  });

  /**
   * @test {detectEnv}
   */
  it('解析 UA_CHROME_DESKTOP', async () => {
    const env = await getDetectEnvResult(UA_CHROME_DESKTOP);

    expect(env).to.include({
      isSQReader: false,
      isAndroid: false,
      isIOS: false,
      isInWV: false,
    });
  });

  /**
   * @test {detectEnv}
   */
  it('解析 UA_CHROME_MOBILE', async () => {
    const env = await getDetectEnvResult(UA_CHROME_MOBILE);

    expect(env).to.include({
      isSQReader: false,
      isAndroid: true,
      isIOS: false,
      isInWV: false,
    });
  });

  /**
   * @test {detectEnv}
   */
  it('解析 UA_TMREADER_ANROID', async () => {
    const env = await getDetectEnvResult(UA_TMREADER_ANROID);

    expect(env).to.include({
      isSQReader: false,
      isAndroid: true,
      isIOS: false,
      isInWV: true,
    });
  });

  /**
   * @test {detectEnv}
   */
  it('解析 UA_TMREADER_IOS', async () => {
    const env = await getDetectEnvResult(UA_TMREADER_IOS);

    expect(env).to.include({
      isSQReader: false,
      isAndroid: false,
      isIOS: true,
      isInWV: true,
    });
  });
});
